import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ScrollToTop from "./ScrollToTop";
import Deshboard_AD from "./Deshboard_AD";
import Deshboard_DR from "./Deshboard_DR";
import Deshboard_CP from "./Deshboard_CP";
import RegistrationForm from "./RegistrationForm";

function App() {
  return (
    <Router>
      <ScrollToTop />
      <Routes>
        <Route path="admin" element={<Deshboard_AD />} />
        <Route path="doctor" element={<Deshboard_DR />} />

        {/* Compounder Layout */}
        <Route path="compounder" element={<Deshboard_CP />}>
          <Route path="registration" element={<RegistrationForm />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
